import React from 'react';
import ListItems from './list_items'

class ListItem extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    return(
      <li className={this.prps.item.liClass}>
        <a href={this.props.item.url}>
        {this.props.item.name}
        </a>
      </li>

    )
  }
}
export default ListItem
